import React from 'react';
import {
    Navbar,
    Nav,
    NavDropdown,
    Form,
    FormControl,
    Button
} from 'react-bootstrap';

export function NavBar () {


    return (
        <Navbar bg="light" expand="lg">
            <Navbar.Brand href="#">Clusters</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="http://localhost:3000/">Home</Nav.Link>
                    <Nav.Link href="http://localhost:3000/register">Registration</Nav.Link>
                    <Nav.Link href="http://localhost:3000/active-dashboard">Dashboard</Nav.Link>
                    <Nav.Link href="http://localhost:3000/login">Login</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}
